<!doctype html>

<script type="module">
function createFromItem(item) {
  const root = document.createElement('div');
  root.classList.add('item');
  root.innerHTML = `
    <div class="mainInfo">
      <div>
        Host: ${item.pl_hostname}<br>
        Name: ${item.pl_name}<br>
        Right ascension: ${item.ra_str}<br>
        Declination: ${item.dec_str}
      </div>
      <div>
        Updated: ${item.rowupdate}
      </div>
    </div>
  `;
  return root;
};

window.generateItems = () => {
  for (const item of window.DATA) {
    document.body.appendChild(createFromItem(item));
  }
};
</script>

<style>
body {
  height: 100vh;
  overflow: auto;
}

.item {

  padding: 4px;
}

.item .mainInfo {
  display: flex;
}
.item .mainInfo > * {
  flex: 1;
}

.keyValue {
  display: inline-block;
  margin: 1px;
  border: 1px solid #ccc;
  padding: 1px;
}

.keyValue .key {
  text-decoration: underline;
}

.keyValue .value {
  font-style: italic;
}
</style>
